import React, { Component } from 'react'


class Maps extends Component {

    constructor() {
        super();
        this.state = {
            car: ['bmw', 'benz', 'tata']
        }
        const mapping = this.state.car.map((item, index) => {
            return (
                <h4>{item}</h4>
            )
        })
    }
    render() {
        return (
            <div>
                <h1>{item}</h1>
            </div>
        )
    }
}

export default Maps;
